import { LeftOutlined } from "@ant-design/icons";
import { Button, Space, Typography } from "antd";
import { useContext } from "react";
import { BookingStatusContext } from "../../../utils/BookingState";
import { StyledButtonNavDiv, StyledContentDiv } from "../../Styles/Div.style";
import { StyledPrompt } from "../../Styles/Title.style";
import { StyledTypography } from "../../Styles/Typography.style";

const Payment = () => {
  const { currentStep, setCurrentStep } = useContext(BookingStatusContext);

  return (
    <>
      <Typography>
        <StyledPrompt level={5}>
          Your payment details are being finalized
        </StyledPrompt>
      </Typography>
      <StyledContentDiv>
        <StyledTypography>
          You will recieve an email when it is ready
        </StyledTypography>
      </StyledContentDiv>
      <br />
      <br />
      <StyledButtonNavDiv>
        <Space>
          <Button
            type="primary"
            shape="circle"
            size="large"
            icon={<LeftOutlined />}
            onClick={() => setCurrentStep(currentStep - 1)}
          />
        </Space>
      </StyledButtonNavDiv>
    </>
  );
};

export default Payment;
